import React, { useState } from "react";
import { predictPremium } from "./api";

function Form({ setResult, setError }) {
  const [formData, setFormData] = useState({
    age: "",
    weight: "",
    height: "",
    income_lpa: "",
    smoker: "false",
    city: "",
    occupation: "retired",
  });

  const handleChange = (e) => {
    const { id, value } = e.target;
    setFormData({ ...formData, [id]: value });
  };

  const handleSubmit = async (e) => {
    e.preventDefault();
    try {
      const payload = {
        age: parseInt(formData.age),
        weight: parseFloat(formData.weight),
        height: parseFloat(formData.height),
        income_lpa: parseFloat(formData.income_lpa),
        smoker: formData.smoker === "true",
        city: formData.city,
        occupation: formData.occupation,
      };

      const response = await predictPremium(payload);
      setResult(response.data.predicted_insurance_premium);
      setError("");
    } catch (error) {
      setResult(null);
      setError(error.response?.data?.error || "Something went wrong");
    }
  };

  return (
    <form onSubmit={handleSubmit} className="space-y-4">
      <div className="grid grid-cols-2 gap-4">
        <div>
          <label className="block text-gray-700 font-medium mb-1">Age</label>
          <input
            id="age"
            type="number"
            className="w-full border border-gray-300 p-2 rounded-lg focus:ring-2 focus:ring-indigo-400"
            onChange={handleChange}
            required
          />
        </div>

        <div>
          <label className="block text-gray-700 font-medium mb-1">Weight (kg)</label>
          <input
            id="weight"
            type="number"
            className="w-full border border-gray-300 p-2 rounded-lg focus:ring-2 focus:ring-indigo-400"
            onChange={handleChange}
            required
          />
        </div>

        <div>
          <label className="block text-gray-700 font-medium mb-1">Height (cm)</label>
          <input
            id="height"
            type="number"
            className="w-full border border-gray-300 p-2 rounded-lg focus:ring-2 focus:ring-indigo-400"
            onChange={handleChange}
            required
          />
        </div>

        <div>
          <label className="block text-gray-700 font-medium mb-1">Income (LPA)</label>
          <input
            id="income_lpa"
            type="number"
            className="w-full border border-gray-300 p-2 rounded-lg focus:ring-2 focus:ring-indigo-400"
            onChange={handleChange}
            required
          />
        </div>

        <div>
          <label className="block text-gray-700 font-medium mb-1">Smoker</label>
          <select
            id="smoker"
            className="w-full border border-gray-300 p-2 rounded-lg focus:ring-2 focus:ring-indigo-400"
            onChange={handleChange}
          >
            <option value="false">No</option>
            <option value="true">Yes</option>
          </select>
        </div>

        <div>
          <label className="block text-gray-700 font-medium mb-1">City</label>
          <input
            id="city"
            type="text"
            className="w-full border border-gray-300 p-2 rounded-lg focus:ring-2 focus:ring-indigo-400"
            onChange={handleChange}
            required
          />
        </div>

        <div className="col-span-2">
          <label className="block text-gray-700 font-medium mb-1">Occupation</label>
          <select
            id="occupation"
            className="w-full border border-gray-300 p-2 rounded-lg focus:ring-2 focus:ring-indigo-400"
            onChange={handleChange}
          >
            <option value="retired">Retired</option>
            <option value="freelancer">Freelancer</option>
            <option value="student">Student</option>
            <option value="government_job">Government Job</option>
            <option value="business_owner">Business Owner</option>
            <option value="unemployed">Unemployed</option>
            <option value="private_job">Private Job</option>
          </select>
        </div>
      </div>

      <button
        type="submit"
        className="bg-indigo-600 hover:bg-indigo-700 text-white font-semibold w-full py-2 rounded-lg transition-all duration-300"
      >
        Predict
      </button>
    </form>
  );
}

export default Form;
